function Table(props) {

    let paginationgrouping=[]
    useEffect(()=>{

      

            if(props.data.length>10)
            {

            }
            else
            {
                paginationgrouping.push("1")
            }

        

    })

  return (
    <div>

<div className="row">
  <div className="col-12">
    <div className="card">
      <div className="card-body">
        <table id="datatable" className="table table-bordered dt-responsive  nowrap w-100">
          <thead>
            <tr>
              {props.columns.map((e)=>
              <th>{e}</th>
              )}
            </tr>
          </thead>
          <tbody>
             {   props.data.map((item)=>
            <tr key={item.id}>
              {
              Object.values(item).map((index)=>
              <td>{index}</td>
              )}
            </tr>
           ) }
         
          </tbody>
         
          <div className="tablepagination ">
              <nav aria-label="Page navigation example">
                 <ul class="pagination">
                    <li class="page-item">
                    <a class="page-link" href="#" aria-label="Previous">
                    <span aria-hidden="true">&laquo;</span>
                    </a>
                    </li>
                    <li class="page-item"><a class="page-link" onClick={()=>{alert(paginationgrouping[0])}}>1</a></li>
                    <li class="page-item">
                    <a class="page-link" href="#" aria-label="Next">
                    <span aria-hidden="true">&raquo;</span>
                    </a>
                    </li>
                    </ul>
                </nav>
          </div>


        </table>
      </div>
    </div>
  </div> {/* end col */}
</div> {/* end row */}


    </div>
  )
}

export default Table
